Information
------------------------------

America the Wild: Night of the Grizzly
Grizzly bear expert Casey Anderson is determined to solve the mystery of the &quot;night grizzly.&quot; According to the stories, a night grizzly is a bold, aggressive predator that conceals itself in a cloak of darkness. After finding an abundance of evidence, such as the carcass of a night grizzly attack victim, it is clear that these predators do exist, and Casey wants to get a closer look. Casey embarks on his epic mission to understand if the legend of the night grizzly has real teeth.

